import React, {Component} from 'react';
import classes from './Dialogs.module.css';
import {NavLink} from "react-router-dom"


const Dialog = (props) => {
    return <div className={classes.dialog + ' ' + classes.active}>
        <NavLink to={"/dialogs/" + props.id}>{props.name}</NavLink>
    </div>
};

const Message = (props) => {
    return <div className={classes.message}>{props.message}</div>
}


const Dialogs = (props) => {
    return (
        <div className={classes.dialogs}>
            <div className={classes.dialogsItems}>
                <Dialog name="Sasha" id="1"/>
                <Dialog name="Kolechka" id="2"/>
                <Dialog name="Andrey" id="3"/>
                <Dialog name="Chekatilo" id="4"/>
                <Dialog name="Vorobey" id="5"/>
            </div>
            <div className={classes.messages}>
                <Message message = 'Hi!'/>
                <div className={classes.message}>Byhai</div>
                <div className={classes.message}>How is your wife?</div>
            </div>
        </div>
    )
};

export default Dialogs;
